import React, { useState } from "react";
import Footer from "../components/Footer";

function BookingPage() {
  const [formValues, setFormValues] = useState({
    name: "",
    email: "",
    month: "",
    day: "",
    year: "",
    hour: "",
    minute: "",
    ampm: "AM",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormValues({
      ...formValues,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    alert("Form Submitted", formValues);
  };

  const generateOptions = (start, end, pad = false) => {
    const options = [];
    for (let i = start; i <= end; i++) {
      const value = pad && i < 10 ? "0" + i : i.toString();
      options.push(
        <option key={value} value={value}>
          {value}
        </option>,
      );
    }
    return options;
  };

  const generateHourOptions = () => {
    const hours = [];
    for (let i = 9; i <= 21; i++) {
      const hour = i > 12 ? i - 12 : i;
      const paddedHour = hour < 10 ? "0" + hour : hour;
      hours.push(
        <option key={hour} value={paddedHour}>
          {paddedHour}
        </option>,
      );
    }
    return hours;
  };

  const generateMinuteOptions = () => {
    const minutes = ["00", "30"];
    return minutes.map((minute) => (
      <option key={minute} value={minute}>
        {minute}
      </option>
    ));
  };

  const currentYear = new Date().getFullYear();

  return (
    <>
      <div className="bookingpage__hero">
        <img className="logo" src="./images/logo.svg" alt="brand logo" />
        <div className="hero-content">
          <h1>Reservations</h1>
          <p>
            We can’t wait to host you. If you have any special requirements
            please feel free to call on the phone number below. We’ll be happy
            to accommodate you.
          </p>
          <button className="mobile">reserve place</button>
        </div>
      </div>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          id="name"
          name="name"
          value={formValues.name}
          onChange={handleChange}
          placeholder="Name"
          required
        />
        <input
          type="email"
          id="email"
          name="email"
          value={formValues.email}
          onChange={handleChange}
          placeholder="Email"
          required
        />
        <div className="date">
          <label>Pick a date</label>
          <select
            id="month"
            name="month"
            value={formValues.month}
            onChange={handleChange}
            required
          >
            <option value="">MM</option>
            {generateOptions(1, 12, true)}
          </select>
          <select
            id="day"
            name="day"
            value={formValues.day}
            onChange={handleChange}
            required
          >
            <option value="">DD</option>
            {generateOptions(1, 31, true)}
          </select>
          <select
            id="year"
            name="year"
            value={formValues.year}
            onChange={handleChange}
            required
          >
            <option value="">YYYY</option>
            {generateOptions(currentYear, 1900)}
          </select>
        </div>
        <div className="time">
          <label>Pick a time</label>
          <select
            id="hour"
            name="hour"
            value={formValues.hour}
            onChange={handleChange}
            required
          >
            <option value="">HH</option>
            {generateHourOptions()}
          </select>
          <select
            id="minute"
            name="minute"
            value={formValues.minute}
            onChange={handleChange}
            required
          >
            <option value="">MM</option>
            {generateMinuteOptions()}
          </select>
          <select
            id="ampm"
            name="ampm"
            value={formValues.ampm}
            onChange={handleChange}
            required
          >
            <option value="AM">AM</option>
            <option value="PM">PM</option>
          </select>
        </div>
      </form>
      <Footer />
    </>
  );
}

export default BookingPage;
